(1, '<!doctype html>\r\n<html lang=\"zxx\">\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<meta name=\"keywords\" content=\"\" />\r\n<meta name=\"description\" content=\"\" />\r\n<meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\r\n<meta name=\"apple-mobile-web-app-capable\" content=\"yes\">\r\n<meta name=\"apple-mobile-web-app-status-bar-style\" content=\"black\">\r\n<meta name=\"apple-mobile-web-app-title\" content=\"School Management System\">\r\n<meta name=\"viewport\" content=\"width=1024,minimal-ui\">\r\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<meta name=\"keywords\" content=\"School Management System\" />\r\n<link rel=\"stylesheet\" href=\"css/tabs.css\" type=\"text/css\" media=\"screen\" />\r\n\r\n<!-- css files -->\r\n<link rel=\"stylesheet\" href=\"css/bootstrap.css\"> <!-- Bootstrap-Core-CSS -->\r\n<link rel=\"stylesheet\" href=\"css/style_bootstrap.css\" type=\"text/css\" media=\"all\" /> <!-- Style-CSS --> \r\n<link rel=\"stylesheet\" href=\"css/font-awesome.css\"> <!-- Font-Awesome-Icons-CSS -->\r\n<link rel=\"stylesheet\" href=\"css/owl.carousel.css\" type=\"text/css\" media=\"all\"/> <!-- Owl-Carousel-CSS -->\r\n<link rel=\"stylesheet\" href=\"css/easy-responsive-tabs.css\"><!-- tabs-css -->\r\n<link rel=\"stylesheet\" href=\"css/monthly.css\">	<!-- Calender-CSS -->\r\n<link href=\"css/popuo-box.css\" rel=\"stylesheet\" type=\"text/css\" media=\"all\" /> <!-- pop-up-box -->\r\n\r\n\r\n<script type=\"application/x-javascript\"> addEventListener(\"load\", function() { setTimeout(hideURLbar, 0); }, false);\r\nfunction hideURLbar(){ window.scrollTo(0,1); } </script>\r\n\r\n<script src=\"scripts/jscript.js\" type=\"text/javascript\"></script>\r\n<script src=\"scripts/jscriptactg.js\" type=\"text/javascript\"></script>\r\n<script src=\"scripts/SpryAccordion.js\" type=\"text/javascript\"></script>\r\n<link href=\"css/SpryAccordion.css\" rel=\"stylesheet\" type=\"text/css\" />\r\n<link href=\"//fonts.googleapis.com/css?family=Lato:100,100i,300,300i,400,400i,700,700i,900,900i&amp;subset=latin-ext\" rel=\"stylesheet\">\r\n<link href=\"//fonts.googleapis.com/css?family=Source+Sans+Pro:200,200i,300,300i,400,400i,600,600i,700,700i,900,900i&amp;subset=latin-ext,vietnamese\" rel=\"stylesheet\">\r\n\r\n                <!-- Dependencies files -->\r\n		<script src=\"scripts/jquery.js\" type=\"text/javascript\"></script>\r\n		<script src=\"scripts/jquery.ui.draggable.js\" type=\"text/javascript\"></script>\r\n		\r\n		<!-- Core files -->\r\n		<script src=\"scripts/jquery.alerts.js\" type=\"text/javascript\"></script>\r\n		<link href=\"css/jquery.alerts.css\" rel=\"stylesheet\" type=\"text/css\" media=\"screen\" />\r\n\r\n  <link rel=\"stylesheet\" href=\"css/jquery-ui.css\">\r\n  <script type=\"text/javascript\" src=\"scripts/jquery-2.1.4.min.js\"></script>\r\n  <script src=\"scripts/jquery-ui.js\"></script>\r\n  <link rel=\"stylesheet\" href=\"css/stylecal.css\">\r\n\r\n<!-- Bootstrap -->\r\n<link href=\"fingerprint/assets/css/bootstrap.min.css\" rel=\"stylesheet\">\r\n<link href=\"fingerprint/assets/css/ajaxmask.css\" rel=\"stylesheet\">\r\n<link href=\"fingerprint/assets/css/style.css\" rel=\"stylesheet\">\r\n\r\n<!-- HTML5 shim and Respond.js for IE8 support of HTML5 elements and media queries -->\r\n<!-- WARNING: Respond.js doesn\'t work if you view the page via file:// -->\r\n<!--[if lt IE 9]>\r\n<script src=\"fingerprint/assets/js/html5shiv.min.js\"></script>\r\n<script src=\"fingerprint/assets/js/respond.min.js\"></script>\r\n<![endif]-->\r\n\r\n<!-- jQuery (necessary for Bootstrap\'s JavaScript plugins) -->\r\n<script src=\"fingerprint/assets/js/jquery.timer.js\"></script>\r\n<!-- Include all compiled plugins (below), or include individual files as needed -->\r\n<script src=\"fingerprint/assets/js/bootstrap.min.js\"></script>\r\n<script src=\"fingerprint/assets/js/ajaxmask.js\"></script>\r\n\r\n<script src=\"fingerprint/assets/js/custom.js\"></script>\r\n<!-- END OF FINGERPRINT SDK -->\r\n\r\n<script src=\"scripts/tinybox.js\"></script>\r\n<script src=\"scripts/payroll.js\" type=\"text/javascript\"></script>\r\n<script src=\"scripts/hr.js\" type=\"text/javascript\"></script>\r\n<script src=\"scripts/tabs.js\" type=\"text/javascript\"></script> \r\n<script src=\"scripts/school.js\" type=\"text/javascript\"></script>\r\n\r\n\r\n<link rel=\"stylesheet\" href=\"css/style.css\" type=\"text/css\" media=\"all\" />\r\n<script>\r\n\r\n\r\nfunction clickIE() {if (document.all) {(message);return false;}}function clickNS(e) \r\n{if (document.layers||(document.getElementById&&!document.all)) {if (e.which==2||e.which==3) {(message);return false;}}}\r\nif (document.layers) {document.captureEvents(Event.MOUSEDOWN);document.onmousedown=clickNS;}\r\nelse{document.onmouseup=clickNS;document.oncontextmenu=clickIE;}\r\ndocument.oncontextmenu=new Function(\"return false\")\r\nfunction timedRefresh(timeoutPeriod) {\r\n		setInterval(function () { isonlist(); },timeoutPeriod);\r\n		//setTimeout(\"location.reload(true);\",timeoutPeriod);\r\n}\r\n\r\nfunction isItNumber(n) {\r\n  return !isNaN(parseFloat(n)) && isFinite(n);\r\n}\r\nfunction isValidNumber(val) {   \r\n	if (val!=\'\') {\r\n		if (val==0) {\r\n			return false;\r\n		} else {\r\n			var validChars = \'-0123456789.,\';\r\n			for(var i = 0; i < val.length; i++) {\r\n			    if(validChars.indexOf(val.charAt(i)) == -1)\r\n				return false;\r\n			}\r\n			return true;\r\n		}\r\n	} else {\r\n		return false;\r\n	}\r\n} \r\nfunction isValidNumberAndZero(val) {   \r\n	if (val!=\'\') {\r\n		\r\n			var validChars = \'0123456789.,\';\r\n			for(var i = 0; i < val.length; i++) {\r\n			    if(validChars.indexOf(val.charAt(i)) == -1)\r\n				return false;\r\n			}\r\n			return true;\r\n		\r\n	} else {\r\n		return false;\r\n	}\r\n} \r\nfunction isValidPosNum(val) {   \r\n	if (val!=\'\') {\r\n		if (val==0) {\r\n			return false;\r\n		} else {\r\n			var validChars = \'0123456789.\';\r\n			for(var i = 0; i < val.length; i++) {\r\n			    if(validChars.indexOf(val.charAt(i)) == -1)\r\n				return false;\r\n			}\r\n			return true;\r\n		}\r\n	} else {\r\n		return false;\r\n	}\r\n} \r\nfunction isValidLong(val) {   \r\n	if (val!=\'\') {\r\n		if (val==0) {\r\n			return false;\r\n		} else {\r\n			var validChars = \'0123456789\';\r\n			for(var i = 0; i < val.length; i++) {\r\n			    if(validChars.indexOf(val.charAt(i)) == -1)\r\n				return false;\r\n			}\r\n			return true;\r\n		}\r\n	} else {\r\n		return false;\r\n	}\r\n} \r\n\r\nfunction ajax_fn(loc,eid) {\r\n	var locfile = loc;\r\n	if (window.XMLHttpRequest) {// code for IE7+, Firefox, Chrome, Opera, Safari\r\n		  xmlhttp=new XMLHttpRequest();\r\n	   } else {// code for IE6, IE5\r\n		  xmlhttp=new ActiveXObject(\"Microsoft.XMLHTTP\");\r\n	   }\r\n	   \r\n	   xmlhttp.onreadystatechange=function() {\r\n		if (xmlhttp.readyState==4 && xmlhttp.status==200) {\r\n		 document.getElementById(eid).innerHTML=\"\";\r\n		 document.getElementById(eid).innerHTML=xmlhttp.responseText;\r\n		\r\n		}\r\n	   }\r\n	   \r\n	   xmlhttp.open(\"GET\",locfile,true);\r\n	   xmlhttp.send();\r\n}\r\nfunction ajax_getResult(loc) {\r\n	var locfile = loc;\r\n	   if (window.XMLHttpRequest) {\r\n		  xmlhttp=new XMLHttpRequest();\r\n	   } else {\r\n		  xmlhttp=new ActiveXObject(\"Microsoft.XMLHTTP\");\r\n	   }\r\n	   \r\n	   xmlhttp.onreadystatechange=function() {\r\n		if (xmlhttp.readyState==4 && xmlhttp.status==200) {\r\n			return xmlhttp.responseText;\r\n		}\r\n	   }\r\n	   xmlhttp.open(\"GET\",locfile,true);\r\n	   xmlhttp.send();\r\n}\r\n\r\nfunction fillcontent(loc) {\r\nvar locfile = loc;\r\nvar verify = object(\'verifyexit\');\r\n	if (verify == null) {\r\n                document.getElementById(\"content\").innerHTML=\"<p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><img src=\'images/loading_image.gif\' alt=\'loading\' /><p>&nbsp;</p><img src=\'images/ajax-loader2.gif\' alt=\'loading2\' /><p><span style=\'color:blue;font-size:14px;font-weight:bold;\'>Please Wait.....</span></p>\";\r\n		ajax_fn(loc,\'content\');\r\n        } else {\r\n	     jConfirm(\'Proceed without Saving Changes on \' + verify.value +\'?\', \'NAVIGATE\', function (r) { \r\n                if (r) {\r\n                      document.getElementById(\"content\").innerHTML=\"<p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><img src=\'images/loading_image.gif\' alt=\'loading\' /><p>&nbsp;</p><img src=\'images/ajax-loader2.gif\' alt=\'loading2\' /><p><span style=\'color:blue;font-size:14px;font-weight:bold;\'>Please Wait.....</span></p>\";\r\n		      ajax_fn(loc,\'content\');\r\n                }\r\n             });	\r\n	}\r\n}\r\n\r\nfunction fillcontentNL(loc) {\r\nvar verify = object(\'verifyexit\');\r\n	if (verify == null) {\r\n		ajax_fn(loc,\'content\');\r\n        } else {\r\n	     jConfirm(\'Proceed without Saving Changes on \' + verify.value +\'?\', \'NAVIGATE\', function (r) { \r\n                if (r) { ajax_fn(loc,\'content\');} \r\n             });\r\n	}\r\n}\r\nfunction fillSubContent(loc,eid) {\r\n\r\nvar verify = object(\'verifyexit\');\r\n	if (verify == null) {\r\n			if (eid!=\'xmenu\') {\r\n			document.getElementById(eid).innerHTML=\"<img src=\'images/ajax-loader3.gif\' alt=\'loading2\' />\";\r\n			}\r\n		ajax_fn(loc,eid);\r\n        } else {\r\n	     jConfirm(\'Proceed without Saving Changes on \' + verify.value +\'?\', \'NAVIGATE\', function (r) { \r\n                if (r) {\r\n			if (eid!=\'xmenu\') {\r\n			document.getElementById(eid).innerHTML=\"<img src=\'images/ajax-loader3.gif\' alt=\'loading2\' />\";\r\n			}\r\n		    ajax_fn(loc,eid);\r\n		}\r\n             });	\r\n      }\r\n}\r\n\r\nfunction fillSubContentGIF(loc,eid) {\r\n	document.getElementById(eid).innerHTML=\"<img src=\'images/please_wait.gif\' alt=\'loading2\' />\";\r\n	ajax_fn(loc,eid);\r\n}\r\n\r\nfunction fillSubContentNL(loc,eid) {\r\nvar verify = object(\'verifyexit\');\r\n	if (verify == null) {\r\n		ajax_fn(loc,eid);\r\n        } else {\r\n	     jConfirm(\'Proceed without Saving Changes on \' + verify.value +\'?\', \'NAVIGATE\', function (r) { \r\n                if (r) { ajax_fn(loc,eid);} \r\n             });\r\n	}\r\n}\r\nfunction isonlist() {\r\n	var onlist = document.getElementById(\"onlist\");\r\n	if (onlist) {\r\n		ajax_fn(\'restobar/getorders.php\',\'neworder\');\r\n	}\r\n}\r\nfunction param(w,h) {\r\n var width  = w;\r\n\r\n var height = h;\r\n\r\n var left   = (screen.width  - width)/2;\r\n\r\n var top    = (screen.height - height)/2;\r\n\r\n var params = \'width=\'+width+\', height=\'+height;\r\n\r\n params += \', top=\'+top+\', left=\'+left;\r\n\r\n params += \', directories=no\';\r\n\r\n params += \', location=no\';\r\n\r\n params += \', resizable=no\';\r\n\r\n params += \', status=no\';\r\n\r\n params += \', toolbar=no\';\r\nreturn params;\r\n}\r\n\r\n\r\nfunction openWin(url)\r\n{\r\nmyWindow=window.open(url,\'mywin\',param(800,500));\r\nmyWindow.focus();\r\n}\r\n\r\nfunction openCustom(url,w,h)\r\n{\r\nmyWindow=window.open(url,\'mywin\',param(w,h));\r\nmyWindow.focus();\r\n}\r\nfunction openCal(id,def) {\r\nopenCustom(\'calendar/?id=\'+id+\'&def=\'+def,200,200);\r\n//showDT(id,def);\r\n}\r\nfunction showDT(id,def) {\r\n	document.getElementById(\"dtpicker\").visibility = \"visible\";\r\n	fillSubContent(\'calendar/?id=\'+id+\'&def=\'+def,\'dtpicker\');\r\n}\r\nfunction hideDT() {\r\ndocument.getElementById(\"dtpicker\").visibility = \"hidden\";\r\n}\r\n\r\nfunction fillcontentNLMC(loc) {\r\nvar verify = object(\'verifyexit\');\r\n	if (verify == null) {\r\n              object(\"main_content\").innerHTML=\"<p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><img src=\'images/loading_image.gif\' alt=\'loading\' /><p>&nbsp;</p><img src=\'images/ajax-loader2.gif\' alt=\'loading2\' /><p><span style=\'color:blue;font-size:14px;font-weight:bold;\'>Please Wait.....</span></p>\";\r\n		\r\n		ajax_fn(loc,\'main_content\');\r\n        } else {\r\n	     jConfirm(\'Proceed without Saving Changes on \' + verify.value +\'?\', \'NAVIGATE\', function (r) { \r\n                if (r) { \r\n		object(\"main_content\").innerHTML=\"<p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><img src=\'images/loading_image.gif\' alt=\'loading\' /><p>&nbsp;</p><img src=\'images/ajax-loader2.gif\' alt=\'loading2\' /><p><span style=\'color:blue;font-size:14px;font-weight:bold;\'>Please Wait.....</span></p>\";\r\n		\r\n			ajax_fn(loc,\'main_content\');} \r\n             });\r\n	}\r\n}\r\n\r\nfunction fnExcelReport() {\r\n		\r\n              var tab_text=\"<table border=\'2px\'><tr bgcolor=\'#87AFC6\'>\";\r\n              var textRange; var j=0;\r\n              tab = document.getElementById(\'headerTable\'); // id of table\r\n	        if (tab==null) {\r\n			tab = document.getElementById(\'trhovergreen\');\r\n			if (tab==null) {\r\n				tab = document.getElementById(\'trhover\');\r\n			}\r\n	        }	\r\n\r\n              for(j = 0 ; j < tab.rows.length ; j++) \r\n              {     \r\n                    tab_text=tab_text+tab.rows[j].innerHTML+\"</tr>\";\r\n                    //tab_text=tab_text+\"</tr>\";\r\n              }\r\n\r\n              tab_text=tab_text+\"</table>\";\r\n              tab_text= tab_text.replace(/<A[^>]*>|<\\/A>/g, \"\");//remove if u want links in your table\r\n              tab_text= tab_text.replace(/<img[^>]*>/gi,\"\"); // remove if u want images in your table\r\n              tab_text= tab_text.replace(/<input[^>]*>|<\\/input>/gi, \"\"); // reomves input params\r\n	      tab_text= tab_text.replace(/&nbsp;<\\//gi, \"</\");\r\n	      tab_text= tab_text.replace(/&nbsp;<\\//gi, \"</\");\r\n\r\n                   var ua = window.navigator.userAgent;\r\n                  var msie = ua.indexOf(\"MSIE \"); \r\n\r\n                     if (msie > 0 || !!navigator.userAgent.match(/Trident.*rv\\:11\\./))      // If Internet Explorer\r\n                        {\r\n                               txtArea1.document.open(\"txt/html\",\"replace\");\r\n                               txtArea1.document.write(tab_text);\r\n                               txtArea1.document.close();\r\n                               txtArea1.focus(); \r\n                                sa=txtArea1.document.execCommand(\"SaveAs\",true,\"exported.xls\");\r\n                              }  \r\n                      else                 //other browser not tested on IE 11\r\n					 \r\n                          sa = window.open(\'data:application/vnd.ms-excel,\' + encodeURIComponent(tab_text));  \r\n                          return (sa);\r\n}	  \r\n\r\n\r\nfunction split_billing(resid,billnum,max) {\r\n	var qty = object(\'qty\').value;\r\n	if (isValidLong(qty)) {\r\n		if (Number(qty) <= Number(max)) {\r\n			jConfirm(\'Are you sure to Process this Split Billing?\', \'Reservation\', \r\n				function (r) { \r\n					if (r) { \r\n					   fillSubContent(\'transactions/show_split.php?resid=\'+resid+\'&billnum=\'+billnum+\'&qty=\'+qty,\'div_tmp\');\r\n					} \r\n				}\r\n			);\r\n\r\n		} else {\r\n			jAlert(\'Maximum Quantity is \' + max);\r\n		}\r\n	} else {\r\n		jAlert(\'Invalid Numeric Format on Quantity\');\r\n	}\r\n}\r\n\r\nfunction setActiveAndNavigate(loc,lid) {\r\n	var i = 1;\r\n	do {\r\n	    $(\'#li\'+i).removeClass(\'active\');\r\n	    i++;\r\n	}\r\n	while (i <= 6);\r\n	$(\'#li\'+lid).addClass(\'active\');\r\n	fillcontentNLMC(loc);\r\n} \r\n\r\nfunction setActiveAndNavigateEmp(loc,lid) {\r\n	var i = 1;\r\n	do {\r\n	    $(\'#li\'+i).removeClass(\'active\');\r\n	    i++;\r\n	}\r\n	while (i <= 6);\r\n	$(\'#li\'+lid).addClass(\'active\');\r\n	fillcontent(loc);\r\n} \r\n\r\nfunction viewSMSAttendance(w,h) {\r\n	w = typeof w !== \'undefined\' ? w : 1275;\r\n  	h = typeof h !== \'undefined\' ? h : 700;\r\n	var rtype 	= object(\'rtype\').value; \r\n	var sy_ayid 	= object(\'sy_ayid\').value; 	\r\n	var gradeid		= object(\'gradeid\').value;\r\n	if (rtype==2) {\r\n		var tap_date = object(\'tap_date\').value;\r\n		openCustom(\'schoolreports/dailyattendance_sms.php?sy_ayid=\'+sy_ayid+\'&rtype=\'+rtype+\'&gradeid=\'+\r\n			    gradeid+\'&tap_date=\'+tap_date,w,h);\r\n	} else {\r\n		var sectionid	= object(\'sectionid\').value;\r\n		if (sectionid!=0) {\r\n			openCustom(\'schoolreports/dailyattendance_sms.php?sy_ayid=\'+sy_ayid+\'&rtype=\'+rtype+\'&gradeid=\'+\r\n					   gradeid+\'&sectionid=\'+sectionid+\'&monthyear=\'+object(\'monthyear\').value,w,h);	\r\n		}\r\n	}\r\n}\r\n\r\nfunction promptDiv(url,w,h) {\r\n	TINY.box.show({url:\'\'+ url,width:w,height:h });\r\n}\r\n\r\nfunction promptMessage(msg) {\r\n	TINY.box.show({html:\'\'+msg+\'&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br /><br />\',animate:false,\r\n	close:false,mask:true,boxid:\'success\',autohide:2});\r\n}\r\n\r\nfunction removeFolder(folderid,foldername) {\r\n		var trans_str = \'Are you sure you DELETE Folder (\'+foldername+\')?\\r\\n<span style=\"color:red\" class=\"blink\">WARNING: All file saved in this folder will be deleted permanently</span>\';\r\n		jConfirm(trans_str, \'DELETE/REMOVE FOLDER\', \r\n				function (r) {\r\n					if (r) { \r\n							var sy_ayid = object(\'sy_ayid\').value;\r\n							object(\'tmp_files\').innerHTML = \'\';\r\n							ajax_fn(\'files/my_folder.php?sy_ayid=\'+sy_ayid+\'&deletefolder=\'+folderid,\'tmp_folder\');\r\n					}\r\n				}\r\n		);\r\n}\r\nfunction showAndRetainUploaderFolder(sy_ayid,accid,folderid,foldername) {\r\n	jConfirm(\'Are you sure you RECOVER Folder (\'+foldername+\')?\', \'RECOVER FOLDER\', \r\n		function (r) {\r\n			if (r) { 	\r\n				fillSubContent(\'files/show_folder.php?sy_ayid=\'+sy_ayid+\'&accid=\'+accid+\'&recoverfolder=\'+folderid,\'tmp_files\');\r\n			}\r\n		}\r\n	);\r\n}\r\n\r\n$( function() {\r\n    $( document ).tooltip();\r\n  } );\r\n\r\n</script>\r\n\r\n', 'Include'),
